import CarouseData from '../API/Carousel.json'
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Home = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: tru
  };
  return (
    <Fragment>
    <Container value='main-container'>
    <Slider {...settings}>

      {CarouseData.homeCarousel.map((item) =>
          <Carousel value={item}/>
      )}
    </Slider>

     </Container>
    </Fragment>
  )
}

export default Home
